                    price: "350",
                },
                {
                    id: 8,
                    name: "товар8",
                    price: "400",
                },
                {
                    id: 9,
                    name: "товар9",
                    price: "450",
                },
                {
                    id: 10,
                    name: "товар10",
                    price: "500",
                },
            ]
        }
    }

    render() {
        return (
            <div className='wrapper'>
                <Header/>
                <Items items={this.state.items}/>
                <Footer/>
            </div>
        );
    }
}

export default App;
